import Post from '../Models/Post.js'
import User from '../Models/User.js'
import Community from './../Models/Community.js'

export async function getOne(req, res) {
	try {
		const { id } = req.params
		const post = await Post.findByIdAndUpdate(
			id,
			{ $inc: { fullViewsCount: 1 } },
			{ returnDocument: 'after' }
		)
		if (!post) {
			return res.status(400).json({
				message: 'Не удалось найти пост',
			})
		}
		const user = await User.findById(post.owner.toString())
		if (!user) {
			return res.status(400).json('Не удалось получить пост')
		}
		const { avatarUrl, name, username, _id, subscribers, isUser } = user
		const { owner, feedViewsCount, fullViewsCount, ...postData } = post._doc
		return res.json({
			counter: { feedViewsCount, fullViewsCount },
			...postData,
			dots: {
				canEdit: req?.userId == owner ? true : false,
				canReport: req?.userId == owner ? false : true,
				canHide: req?.userId == owner ? false : true,
				canPin: req?.userId == owner ? true : false,
				canDelete: req?.userId == owner ? true : false,
			},
			author: {
				avatarUrl,
				name,
				username,
				_id,
				isSubscribed: req?.userId
					? subscribers?.find(
							sub => sub._id.toString() == req?.userId.toString()
					  )
						? true
						: false
					: false,
				isUser,
			},
		})
	} catch (err) {
		console.log(err)
		return res.status(500).json({
			message: 'Не удалось получить пост',
		})
	}
}

export async function getAll(req, res) {
	try {
		const limit = Number(req.query.limit)
		const skip = Number(req.query.skip)
		if (req.query.nickname) {
			const nickname = req.query.nickname
			const community = await Community.findOne({ nickname })
			if (!community) {
				return res.status(404).json({ message: 'Сообщество не было найдено' })
			}
			const postsLength = await Post.find({ 'subsite._id': community._id })
			let posts = await Post.find({ 'subsite._id': community._id })
				.skip(skip)
				.limit(limit)
				.lean()
			posts.map(async post => {
				await Post.findByIdAndUpdate(
					post._id,
					{ $inc: { feedViewsCount: 1 } },
					{ returnDocument: 'after' }
				)
			})
			posts = posts.map(post => {
				const {
					owner,
					feedViewsCount,
					fullViewsCount,
					reactions,
					...postData
				} = post
				return {
					counter: { feedViewsCount, fullViewsCount },
					reactions: {
						counters: reactions.counters,
						reactionId: req.userId
							? reactions.counters
									?.map((el, index) => {
										if (el.users.filter(id => id == req.userId).length != 0) {
											return index + 1
										}
									})
									.filter(el => el != null)[0]
							: 0,
					},
					...postData,
					dots: {
						canEdit: req?.userId == owner ? true : false,
						canReport: req?.userId == owner ? false : true,
						canHide: req?.userId == owner ? false : true,
						canPin: req?.userId == owner ? true : false,
						canDelete: req?.userId == owner ? true : false,
					},
					author: {
						avatarUrl,
						name,

						_id,
						isSubscribed: req?.userId
							? subscribers?.find(
									sub => sub._id.toString() == req?.userId.toString()
							  )
								? true
								: false
							: false,
						isUser,
					},
				}
			})
			return res.json({
				data: posts,
				postsLength: postsLength.length,
			})
		}
		if (req.query.username) {
			const username = req.query.username
			const user = await User.findOne({ username })
			if (!user) {
				return res.status(404).json({ message: 'Пользователь не был найден' })
			}
			const postsLength = await Post.find({ owner: user.id })
			let posts = await Post.find({ owner: user.id })
				.skip(skip)
				.limit(limit)
				.lean()

			for (const post of posts) {
				await Post.findByIdAndUpdate(
					post._id,
					{ $inc: { feedViewsCount: 1 } },
					{ returnDocument: 'after' }
				)
			}

			const { avatarUrl, name, _id, isUser, subscribers } = user
			posts = posts.map(post => {
				const {
					owner,
					feedViewsCount,
					fullViewsCount,
					reactions,
					...postData
				} = post
				return {
					counter: { feedViewsCount, fullViewsCount },
					reactions: {
						counters: reactions.counters,
						reactionId: req.userId
							? reactions.counters
									?.map((el, index) => {
										if (el.users.includes(req.userId)) {
											return index + 1
										}
									})
									.filter(el => el != null)[0]
							: 0,
					},
					...postData,
					dots: {
						canEdit: req.userId == owner,
						canReport: req.userId != owner,
						canHide: req.userId != owner,
						canPin: req.userId == owner,
						canDelete: req.userId == owner,
					},
					author: {
						avatarUrl,
						name,
						username,
						_id,
						isSubscribed: req.userId
							? subscribers?.some(
									sub => sub._id.toString() == req.userId.toString()
							  )
							: false,
						isUser,
					},
				}
			})

			return res.json({
				data: posts,
				postsLength: postsLength.length,
			})
		}

		const postsLength = await Post.find()
		const allPosts = await Post.find().skip(skip).limit(limit).lean()
		const userIds = allPosts.map(post => post.owner)
		const users = await User.find({ _id: { $in: userIds } }).lean()
		let posts = allPosts.map(post => {
			const user = users.find(
				user => user._id.toString() === post.owner.toString()
			)
			const { avatarUrl, name, username, _id, isUser, subscribers } = user
			const { owner, feedViewsCount, fullViewsCount, reactions, ...postData } =
				post

			return {
				counter: { feedViewsCount, fullViewsCount },
				...postData,
				reactions: {
					counters: reactions.counters,
					reactionId: req.userId
						? reactions.counters
								?.map((el, index) => {
									if (el.users.includes(req.userId)) {
										return index + 1
									}
								})
								.filter(el => el != null)[0]
						: 0,
				},
				dots: {
					canEdit: req.userId == owner,
					canReport: req.userId != owner,
					canHide: req.userId != owner,
					canPin: req.userId == owner,
					canDelete: req.userId == owner,
				},
				author: {
					avatarUrl,
					name,
					username,
					_id,
					isSubscribed: req.userId
						? subscribers?.some(
								sub => sub._id.toString() == req.userId.toString()
						  )
						: false,
					isUser,
				},
			}
		})

		for (const post of posts) {
			await Post.findByIdAndUpdate(
				post._id,
				{ $inc: { feedViewsCount: 1 } },
				{ returnDocument: 'after' }
			)
		}

		return res.json({
			data: posts,
			postsLength: postsLength.length,
		})
	} catch (err) {
		console.error(err)
		return res.status(500).json({ message: 'Не удалось получить все посты' })
	}
}
export async function createOne(req, res) {
	try {
		const { title, blocks, subsite } = req.body
		const user = User.findById(req.userId)
		if (!user) {
			return res.status(400).json({
				message: 'Пользователь не был найден',
			})
		}
		if (subsite) {
			const community = await Community.findById(subsite)
			const post = new Post({
				title,
				blocks,
				owner: req.userId,
				subsite: {
					_id: community._id,
					name: community.name,
					nickname: community?.nickname,
					avatarUrl: community?.avatarUrl,
				},
			})
			await post.save()
		} else {
			const post = new Post({
				title,
				blocks,
				owner: req.userId,
			})
			await post.save()
		}
		return res.json({
			message: 'Пост был успешно создан',
		})
	} catch (err) {
		console.log(err)
		return res.status(500).json({
			message: 'Не удалось создать пост',
		})
	}
}
export async function deleteOne(req, res) {
	try {
		const { id } = req.params
		const post = await Post.findById(id)
		if (!post) {
			return res.status(400).json({
				message: 'Не удалось найти пост',
			})
		}
		if (post?.owner?.toString() == req.userId.toString()) {
			await Post.findByIdAndDelete(id)
			return res.json({ message: 'Пост успешно удален' })
		} else {
			return res.status(400).json({
				message: 'Не удалось удалить пост, так как вы не создатель этого поста',
			})
		}
	} catch (err) {
		console.log(err)
		return res.status(500).json({
			message: 'Не удалось удалить пост',
		})
	}
}
export async function deleteAll(req, res) {
	try {
		await Post.deleteMany()
		return res.json({
			message: 'Посты успешно удалены',
		})
	} catch (err) {
		return res.status(500).json({
			message: 'Не удалось удалить посты',
		})
	}
}
