export async function reactPost(req, res) {
	try {
		const { postId, reactionId } = req.query

		// Check if postId exists
		if (!postId) {
			return res.status(400).json({
				message: 'Забыли передать id поста',
			})
		}

		// Get post by id
		const post = await Post.findById(postId)
		// Check if post exists
		if (!post) {
			return res.status(400).json({
				message: 'Не удалось найти пост',
			})
		}
		if (post?.author?._id.toString() === req.userId.toString()) {
			return res.status(400).json({
				message: 'Нельзя ставить реакцию на свой пост',
			})
		}

		const { reactions } = post
		const { counters } = reactions

		const currentReactionId = reactions.counters.find(counter =>
			counter.users.find(id => id === req.userId)
		)?.id

		// Update counters
		const updatedCounters = counters.map(counter => {
			if (
				counter.id === Number(reactionId) &&
				Number(currentReactionId) !== Number(reactionId)
			) {
				counter.count += 1
				counter.users = [req.userId, ...counter.users]
			}
			if (
				counter.id === Number(currentReactionId) &&
				Number(currentReactionId) !== Number(reactionId)
			) {
				counter.count -= 1
				counter.users = counter.users?.filter(
					id => id.toString() !== req.userId.toString()
				)
			}
			if (
				counter.id === Number(currentReactionId) &&
				Number(currentReactionId) === Number(reactionId)
			) {
				counter.count -= 1
				counter.users = counter.users?.filter(
					id => id.toString() !== req.userId.toString()
				)
			}
			return counter
		})

		// Update reactionId
		const newReactionId =
			Number(reactionId) === Number(currentReactionId) ? 0 : Number(reactionId)

		// Update post
		await Post.findByIdAndUpdate(postId, {
			reactions: {
				counters: updatedCounters,
				reactionId: newReactionId,
			},
		})

		return res.json({
			id: postId,
			reactions: {
				counters: updatedCounters,
				reactionId: newReactionId,
			},
		})
	} catch (err) {
		console.error(err) // Log error
		return res.status(500).json({
			message: 'Не удалось поставить реакцию',
		})
	}
}
